import React from "react";
import {
  Box,
  Container,
  Row,
  Column,
  FooterLink,
  Heading,
} from "./FooterStyles";
  
const Footer = () => {
  return (
    <Box>
      <h1 style={{ color: "gray", 
                   textAlign: "center",  }}>
        Yigithan Guven 2021
      </h1>
    </Box>
  );
};
export default Footer;
